erage('codeCov_after.xml')\\n\\nprint(f\\\"BEFORE: {before[0]}/{before[1]} lines ({before[2]:.1f}% line, {before[3]:.1f}% branch)\\\")\\nprint(f\\\"AFTER:  {after[0]}/{after[1]} lines ({after[2]:.1f}% line, {after[3]:.1f}% branch)\\\")\\nprint(f\\\"IMPROVEMENT: +{after[0] - before[0]} lines (+{after[2] - before[2]:.1f} pp)\\\")\\n```\\n\\n## Testing Strategy\\n\\nThese tests were designed to:\\n- **Validate algorithmic correctness**: Ensure Savitzky-Golay filter works correctly for various data types (linear, quadratic, noisy signals)\\n- **Test derivative calculations**: Verify 1st and 2nd derivatives match analytical expectations\\n- **Cover error paths**: Validate all parameter validation and error messages\\n- **Test edge cases**: Minimum configurations, constant signals, outlier handling\\n- **Verify optimization**: Test autocorrelation-based window width optimization with different polynomial orders\\n- **Ensure numerical stability**: Check for NaN/Infinity in outputs with various inputs\\n\\n## Background on Savitzky-Golay Filtering\\n\\nThe Savitzky-Golay filter is a sophisticated digital filter that:\\n- **Smooths data** by fitting successive windows of data with low-degree polynomials via least-squares\\n- **Preserves features** better than moving averages (maintains peak shapes and widths)\\n- **Calculates derivatives** as a byproduct of the polynomial fit\\n- **Widely used** in spectroscopy, chromatography, and general signal processing\\n\\nThe `optimizeWindowWidth` function implements the method from Anal. Chem. 2006, 78, 5, 1515-1522, which:\\n- Estimates noise autocorrelation from a blank signal\\n- Tests multiple window widths to find optimal smoothing\\n- Balances noise reduction with signal preservation\\n\\n## Future Improvement Opportunities\\n\\nBased on coverage analysis, additional high-value testing areas include:\\n1. **Signal Processing** modules (0% coverage in many):\\n   - FFT operations (160 lines, 0% coverage)\\n   - PeakDetection (30