le quadratic**: Tests `f(x) = xÂ²` with minimum at x=0\\n- **Shifted quadratic**: Tests `f(x) = (x-3)Â²` with minimum at x=3\\n- **Cubic function**: Tests `f(x) = xÂ³ - 6xÂ² + 9x + 1` with minimum at x=3\\n- **Transcendental function**: Tests `sin(x)` finding minimum at 3Ï€/2\\n- **Exponential function**: Tests `exp(xÂ²)` with minimum at x=0\\n\\n### 2. Boundary Condition Tests (2 test cases)\\n- **Minimum at lower bound**: When true minimum is outside interval\\n- **Minimum at upper bound**: When minimum occurs at boundary\\n\\n### 3. Custom Parameters Tests (2 test cases)\\n- **minimizeWith with high precision**: Tests custom tolerance (1e-10) and iteration limit (200)\\n- **Insufficient iterations**: Validates return of `None` when max iterations reached\\n\\n### 4. Maximization Tests (2 test cases)\\n- **maximize negative quadratic**: Finds maximum of `-(x-2)Â² + 5`\\n- **maximizeWith**: Tests custom parameters for maximization\\n\\n### 5. Error Handling Tests (6 test cases)\\n- **NaN lower bound**: Should throw exception\\n- **Infinity upper bound**: Should throw exception\\n- **NaN tolerance**: Should throw exception\\n- **Zero tolerance**: Should throw exception (must be positive)\\n- **Negative tolerance**: Should throw exception\\n- **Function returns NaN/Infinity**: Should throw when function is not finite\\n\\n### 6. Edge Cases (3 test cases)\\n- **Reversed bounds**: Tests automatic swapping when upper \\u003c lower\\n- **Narrow interval**: Tests convergence in small interval [-0.1, 0.1]\\n- **Absolute value function**: Tests non-smooth function\\n\\n### 7. Additional Function Types (4 test cases)\\n- **Cosine function**: Periodic function with known minima/maxima\\n- **Quartic function**: More complex polynomial\\n- Various other test functions to ensure robustness\\n\\n## Test Coverage Results\\n\\n### Brent Module (Optimization/BrentExt.fs)\\n| Metric | Before | After | Improvement |\\n|--------|--------|-------|-------------|\\n| **Line Coverage** | 0